function frameUpdater(player,pKeys){
  if(pKeys['w'])player.move(0,-10);
  if(pKeys['s'])player.move(0,10);
  if(pKeys['a'])player.move(-10,0);
  if(pKeys['d'])player.move(10,0);
}
export default frameUpdater
